import React from 'react';
import cart from '../assets/img/empty-cart.png'

function Cart(props) {
    return (
        <div className="cart">
            <div className="content">
                <div className="container">
                    <img className="cart__empty" src={cart} alt="" />
                </div>
            </div>
        </div>
    );
}

export default Cart;
